import React from 'react';
import { Component, createContext } from 'react';
const NameContext = createContext();
class B extends Component {
render(){
    return (
      <NameContext.Consumer>
        {name => <div>姓名: {name}</div>}
      </NameContext.Consumer>
    );
  }
}

export default B;
